import React from "react";
import Menu from "./Menu";

function Problem() {
  const id = 1;
  const uid = 1;
  var socket = new WebSocket(
    "ws://127.0.0.1:8000/ws/runcode/" + uid.toString()
  );

  return (
    <div>
      <Menu id={id} uid={uid} />
    </div>
  );
}

export default Problem;
